  {
    checksum = "8b2d4bef7354d1ad9d466b6749d2f69060ecb9e468d54c2bbf29152534e0728c",
    path = "themes/base/partials/auth/forms/login/key-auth.html",
    contents = [[  <form id="login" data-type="key-auth">
    <p class="form-error-message toggle-content"></p>

    <label for="email">{{l("login_form_email_label", "Email")}}</label>
    <input id="email" type="text" name="email" required />

    <label for="key">{{l("login_form_key_label", "Key")}}</label>
    <input id="key" type="password" name="key" required />

    <p>
      <a href="reset-password">
        {{l("login_form_forgot_password", "Forgot Password?")}}
      </a>
    </p>

    <button
      id="login-button"
      class="btn btn-primary"
      type="submit">{{l("login_form_button_text", "Login")}}</button>
  </form>

  <script type="text/javascript">
    window.addEventListener("load", function() {
      var $FORM = $("#login");
      var $FORM_ERROR = $FORM.find(".form-error-message")

      // Submission variables
      var baseApiUrl = window.Kong.getApiUrl();
      var authType = Kong.Auth.KEY_AUTH;
      var redirectTo = Kong.Auth.getRedirectTo('{{portal.redirect.login}}')

      // Handle form state
      var onSubmit = function() {
        $FORM_ERROR
          .removeClass('is-visible')
          .html('');

        Kong.Auth.login({
          baseUrl: baseApiUrl,
          type: authType,
          fields: $FORM.serializeArray()
        }).then(onSuccess).catch(onError)
      }

      var onSuccess = function() {
        window.location.href = redirectTo;
      }

      var onError = function(data) {
        $FORM_ERROR
          .addClass('is-visible')
          .html(data.message || 'An unexpected error occurred. Please try again.');
      }


      // Handle form button press
      $FORM.on('submit', function(event) {
        event.preventDefault();
        onSubmit();
      })
    })
  </script>
]]
