}
*/

/*
 * Homepage Component -- Hero
 */

.homepage-hero {
  margin: 0 auto;
  padding: 120px 0;
  text-align: center;

  background: var(--hero, #000000);
  background-image: url("{*portal.url*}/assets/images/bg-pattern.svg");
  color: var(--text_hero, #FFFFFF);
}

.homepage-hero h2 {
  margin-bottom: 1rem;
  color: var(--text_hero, #FFFFFF);
}

.homepage-hero p {
  font-size: 24px;
  font-weight: 400;
  color: var(--text_hero, #888888);
}

.homepage-hero .hero-footer .btn {
  font-size: 16px;
  padding: .6em 2em;
}

/* Desktop Sizings */

@media(min-width: 749px) {
  .homepage-hero {
    padding: 180px 0;
  }
}

/*
 * Homepage Component -- Catalog
 */

.homepage-catalog {
  width: 100%;
  padding: 0 2rem;
  text-align: center;
  margin-top: -30px;
}

.homepage-catalog .catalog-footer {
  padding: 2rem 0;
}

/* Desktop Sizings */

@media(min-width: 749px) {
  .homepage-catalog {
    width: 90%;
    margin: -30px auto 0;
  }
}

@media(min-width: 1000px) {
  .homepage-catalog {
    width: 70%;
  }
}

/*
 * Homepage Component -- Client List
 */

.homepage-clients {
  padding: 100px 0;
  text-align: center;
}

.homepage-clients .client {
  padding: 2.5rem 5rem;
  margin: 1rem;
  background: #f5f5f5;
  color: #aaa;
  font-weight: 500;
  display: inline-block;
}

/*****************************************
 * Page -- Service Catalog
 *****************************************/

.service-catalog {
  padding-top: 0 !important;
}

.service-catalog .catalog-item {
  min-height: 156px;
  box-shadow: 0 2px 3px rgba(0,0,0,0.06);
  border-radius: 3px;
  text-decoration: none;
  border: 1px solid #ddd;
}

/*****************************************
 * Page -- About
 *****************************************/

/*
 * About Section -- Hero
 */

.about .about-hero {
  padding: 5em 0;
  background: var(--hero);
}

.about .about-hero h6 {
  margin-bottom: .5em;
  text-transform: uppercase;
  color: var(--text_hero);
}

.about .about-hero h2 {
  color: var(--text_hero);
}

.about .about-hero li {
  color: var(--text_hero);
}


/*
 * About Section -- Team
 */

.about .about-team {
  padding: 3em 0;
  text-align: center;
}

.about .member-title {
  color: var(--text_secondary, #8C8C8C);
}

/*****************************************
 * Page -- 404
 *****************************************/

.error-404 {
  background-color: #f8f8f8;
  text-align: center
}

.error-404.align-container {
  height: 100vh;
}

.error-404 .title {
  color: var(--primary);
  font-weight: 400;
  font-size: 1.75em;
  margin-top: 0
}

.error-404 p {
  color: var(--tertiary);
}

@media (min-width: 768px) {
  .error-404 .title {
    font-size: 2.5em
  }
}

/*****************************************
 * Page -- Auth (Basic Auth / Key Auth / OIDC)
 *****************************************/

.auth-page {
  height: calc(100vh - 74px - 90px);
  display: flex;
  flex-direction: row;
}

.auth-page > section,
.auth-page > div {
  flex: 1;
}

.auth-page .left-pane {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}

.auth-page .left-pane .inner {
  width: 40rem;
}

.auth-page .left-pane input {
  width: 100%;
}

.auth-page .right-pane {
  display: none;
  background: black;
  background: var(--hero, black);
  color: white;
  text-align: center;
  align-items: center;
  justify-content: center;
}

.auth-page .right-pane .inner {
  text-align: center;
  min-width: 300px;
  width: 40%;
}

.auth-page .right-pane .inner h2,
.auth-page .right-pane .inner h3,
.auth-page .right-pane .inner h4,
.auth-page .right-pane .inner h5,
.auth-page .right-pane .inner p {
  color: var(--accent, white);
}

@media (min-width: 768px) {
  .auth-page .right-pane {
    display: flex;
  }
}

/*****************************************
 * Page -- Auth (Basic Auth / Key Auth / OIDC)
 *****************************************/

 .page .dashboard {
   padding: 2em 0;
 }

/*****************************************
 * Utilities
 *****************************************/

.page {
  /* 90px for header 74px for footer */
  min-height: calc(100vh - 74px);
