  display: table;
  width: 100%;
  height: 100%
}

.align-inner {
  display: table-cell;
  vertical-align: middle
}

.align-inner--top {
  vertical-align: top
}

.align-inner--bottom {
  vertical-align: bottom
}

.toggle-content {
	display: none;
}

.toggle-content.is-visible {
	display: inherit;
}

@media (min-width: 768px) {
  .align-right {
    text-align:right
  }
}
